import "./overview.css";
import { Grid } from "@material-ui/core";
import arrow from "../assets/images/arrow.svg";

function Overview() {
  return (
      <div>
          <p className="overview-header-text">Overview</p>

          <Grid container>
              <Grid item sm={1}>
                  <img src="../assets/images/arrow.svg" alt="" className="overview-arrow"/>
              </Grid>
          </Grid>
      </div>
  )
}

export default Overview;
